#include <string.h>

//密码检查

int havenum(char* p)
{
    int len = strlen(p);
    for (int i = 0; i < len; i++)
    {
        if (p[i] >= '0' && p[i] <= '9')
        {
            return 1;
        }
    }
    return 0;
}

int havelow(char* p)
{
    int len = strlen(p);
    for (int i = 0; i < len; i++)
    {
        if (p[i] >= 'a' && p[i] <= 'z')
        {
            return 1;
        }
    }
    return 0;
}

int havehigh(char* p)
{
    int len = strlen(p);
    for (int i = 0; i < len; i++)
    {
        if (p[i] >= 'A' && p[i] <= 'Z')
        {
            return 1;
        }
    }
    return 0;
}

